import styled from "@emotion/styled";

const Basket = styled.h1`
 font-size: 20px;
 color: #fff;
 font-style: normal;
 font-variant: normal;
 font-weight: 500;
 line-height: 30px;
 display: flex;
 justify-content: center;
`;

export default Basket;
